Sniper Tactical 4x32 Prismatic Glass Crosshair Reticle Scope w/ Fiber Optic Sight

New condition. Purchased with my AR-15, but with my eyesight I need the big iron A sight. This sight has three different color crosshairs, as well as three levels of brightness for each one. My loss is your gain!

SNIPER Advanced Combat 30MM 4X32 Prism Scope with Built-in Optic Front Sight and W/E Adjustable Rear Sight, Double Side Rails, Etched Glass Rapid Range Finding Ballistic Reticle with Red/Green/Blue Tri-Color Illumination, Integral Picatinny Mount. Versatile, durable, and precise prismatic glass scope; 
4X magnification; 32 mm objective diameter;
Precise 1/4 MOA Click Value for Windage and Elevation Adjustment; 
3.5" eye relief; 
6" long, 1.03lb 
Integral Angle Sunshade Included
One 2032 Battery Included; 
Limited Lifetime Manufacturer Warranty.

$113 at Amazon
